import React from "react";
import { Wrapper } from "../context/userContext";
import { Settings } from "./Settings";
import { Home } from "./Home";
const App = () => {
  return (
    <div id="main">
      <Wrapper>
        <Settings />
        <Home />
      </Wrapper>
    </div>
  );
};

export default App;
